libs.content:
find_library(pcre_library_release
    names
        pcre
        libpcre
    hints
        ${pc_pcre_libdir}
        ${pc_pcre_library_dirs}
        env pcre_dir
    path_suffixes
        ${lib_path_suffixes}
    paths
        ${pcre_path}
)

find_library(ptw_${flavor}_library_release
            names 
                libpthreadg${flavor}3  pthreadg${flavor}3
            hints
                env ptw_ dir
            path_suffixes
                ${lib_path_suffixes}
            paths
                ${ptw_path}
        )

find_library(ptw_${flavor}_library_debug
            names 
                libpthreadg${flavor}3d  pthreadg${flavor}3d
            hints
                env ptw_ dir
            path_suffixes
                ${lib_path_suffixes}
            paths
                ${ptw_path}
        )
